import React from "react";
import { TableStyled, TheadStyled } from "./TransactionHistory.styled";

const TransactionHistory = ({ transactions }) => {
  return (
    <TableStyled>
      <TheadStyled>
        <tr>
          <th>Type</th>
          <th>Amount</th>
          <th>Currency</th>
        </tr>
      </TheadStyled>
      <tbody>
        <tr>
          <td>{type}</td>
          <td>{amount}</td>
          <td>{currency}</td>
        </tr>
      </tbody>
    </TableStyled>
  );
};

export default TransactionHistory;
